        function Jakobi(mass) {
            var mass_X = [];
            var mass_Xnext = [];
            var mass_d =[];
            
            for (let i = 0; i < mass.length; ++i){                    //задвинули массив начальных приближений
                mass_X[i] = mass[i][mass[i].length-1]/mass[i][i];
            }
            
            
            for(let n = 0; ;++n){
                
                for (let j = 0; j < mass.length; ++j) {                   //вычисляем следующие приближения
                    mass_Xnext[j] = 0;

                    Q[j] = [];
                        };
                    for(let k = 0; k < mass[0].length; ++k){

                             }

                        }

                        Q[j][k] = -mass[j][k]/mass[j][j];
                             }

                        }
                    }
                    
                }
                if(n==0){
                    for(let r = 0; r < Q.length; ++r){

                            if(Q[r][l]<0){
                                Q[r][l] = Q[r][l]*(-1);
                            }
                            norma[r] += Q[r][l]; 
                        }
                    }
                    
                  max_norma = Math.max.apply(null, norma);

                        return 0;
                    }
                }
                
                for(let k = 0; k<mass_Xnext.length; ++k){                //вычисляем разницу между соседними приближениями
                   mass_d[k] = mass_Xnext[k] - mass_X[k];
                    if(mass_d[k]<0)
                        mass_d[k] = mass_d[k]*(-1);
                }
                
                let max_d = Math.max.apply(null, mass_d);                //находим максимальную разность
                
                
                
                if(max_d <(((1-max_norma)/max_norma)*0.01) ){
                    return mass_Xnext;
                    break;
                }
                let span_f = document.createElement('span');
                span_f.classList.add('span');
                span_f.textContent = 'D'+(n+1)+' = '+max_d;
                span_f.style.display = 'inline-block';
                body.append(document.createElement('br'));
                body.append(span_f);
                for(let l = 0; l < mass_Xnext.length; ++l){             //присваиваем массиву предыдущих приближений значения найденных на шаге
                    mass_X[l] = mass_Xnext[l];
                }
            if(n>100){
                alert("Aaaaa-a-a-a-a-a-a, stop it, please! Too many iterations")
                break;
            }
                console.log(n+" iter");
            } 
            
        };
        
        function Zeydel(mass) {
            var mass_X = [];
            var mass_Xnext = [];
            var mass_d =[];
            
            for (let i = 0; i < mass.length; ++i){                    //вычислили массив начальных приближений
                mass_X[i] = mass[i][mass[i].length-1]/mass[i][i];
            }
            
            
            for(let n = 0; ;++n){
                
                for (let j = 0; j < mass.length; ++j) {                   //вычисляем следующие приближения
                    
                    mass_Xnext[j] = 0;
                    
                    if (n==0) {
                    Q[j] = [];
                        };
                    
                    for(let k = 0; k < mass[0].length; ++k){
                        if (j == k){
                             if (n==0) {
                            Q[j][k] = 0;
                             }
                            continue;
                        }
                        if (k == mass[0].length-1)
                        mass_Xnext[j] +=mass[j][k]/mass[j][j];
                        
                        else{
                            
                          if (n==0) {
                        Q[j][k] = -mass[j][k]/mass[j][j];
                             }   
                            if(k<j){
                               mass_Xnext[j] -=mass[j][k]*mass_Xnext[k]/mass[j][j];  
                            }
                            else{
                            mass_Xnext[j] -=mass[j][k]*mass_X[k]/mass[j][j];    
                            }
                         
                        }
                    }
                    
                }
                if(n==0){
                    for(let r = 0; r < Q.length; ++r){
                        norma[r] = 0;
                        for (let l = 0; l < Q[0].length; ++l){
                            if(Q[r][l]<0){
                                Q[r][l] = Q[r][l]*(-1);
                            }
                            norma[r] += Q[r][l]; 
                        }
                    }
                    
                  max_norma = Math.max.apply(null, norma);
                    if(max_norma > 1){
                        alert("Норма матрицы у вас, молодой человек, too big :(");
                        return 0;
                    }
                }
                
                for(let k = 0; k<mass_Xnext.length; ++k){                //вычисляем разницу между соседними приближениями
                   mass_d[k] = mass_Xnext[k] - mass_X[k];
                    if(mass_d[k]<0)
                        mass_d[k] = mass_d[k]*(-1);
                }
                
                let max_d = Math.max.apply(null, mass_d);                //находим максимальную разность
                
                
                if(max_d <(((1-max_norma)/max_norma)*0.01) ){
                    return mass_Xnext;
                    break;
                }
                let span_f = document.createElement('span');
                span_f.classList.add('span');
                span_f.textContent = 'D'+(n+1)+' = '+max_d;
                span_f.style.display = 'inline-block';
                span_f.style.borderColor = 'green';
                body.append(document.createElement('br'));
                body.append(span_f);
                for(let l = 0; l < mass_Xnext.length; ++l){             //присваиваем массиву предыдущих приближений значения найденных на шаге
                    mass_X[l] = mass_Xnext[l];
                }
            if(n>100){
                alert("Aaaaa-a-a-a-a-a-a, stop it, please! Too many iterations")
                break;
            }
                console.log(n+" iter");
            } 
            
        };
